'''Storkvarvet Mountain''' is a mountain that is round in plan and has several radial spurs, standing N of [[Haberrnehl Peak]] at the NE end of the [[Muhlig-Hofmann Mountains]], [[Queen Maud Land]].
==Discovery and naming== Storkvarvet Mountain was photographed from the air by the [[Third German Antarctic Expedition]] (1938â1939), led by Capt. [[Alfred Ritscher]]. Plotted from surveys and air photos by the [[Sixth Norwegian Antarctic Expedition]] (1956â60) and named Storkvarvet (the big round of logs).<ref>[http://geonames.usgs.gov/pls/gnispublic/ USGS GNIS: Storkvarvet Mountain]</ref>
